function BOOT()
    trace("Booting... '"..META.TITLE.."' BUILD: "..META.VERSION)

    if DEMO_MODE then
        trace("Set as DEMO build.")
    end

    if IS_EXPORT then
        trace("Set as export build.")
    else 
        trace("Custom package path set.")
    end

    -- frame counter
    FRAME = -1

    -- cursor global
    CURSOR = {
        x = -1,
        y = -1,
        left = false,
        middle = false,
        right = false,
        scrollx = 0,
        scrolly = 0,
    }

    -- globals
    SCREEN = {
        WIDTH = 240,
        HEIGHT = 136
    }

    -- set inital state
    local start_state = StateIntro()
    if DEBUG_MODE and DEBUG_SKIP_INTRO then
        start_state = StateLevel()
    end

    -- debug
    if DEBUG_MODE then
        debugMode = DebugMode()
        trace("DEBUG_MODE is set to active.")
    end

    -- setup state manager with inital state
    STATE_MANAGER = StateManager(start_state)
end

function TIC()
    -- DEPRECATED VAR
    local dt = 1

    -- debug update
    if debugMode then debugMode:update(dt) end

    -- cursor update
    CURSOR.x, CURSOR.y, CURSOR.left, CURSOR.middle, CURSOR.right, CURSOR.scrollx, CURSOR.scrolly = mouse()

    -- state update
    STATE_MANAGER:update(dt)

    -- render update
    cls(0)
    STATE_MANAGER:render()
    if debugMode then debugMode:render() end

    FRAME = FRAME + 1
end

function OVR()
    STATE_MANAGER:overlay()
end

function SCN(scanline)
    STATE_MANAGER:scanline(scanline)
end

